    false,nt"url": null,nt"notes": "Aerial photographs for Pools 1-13 Upper
    Mississippi River System and Pools, Alton-Marseilles, Illinois River were collected
    in color infrared (CIR) in August of 2010 at 8u00e2u0080u009d/pixel and 16u00e2u0080u009d/pixel
    respectively using a mapping-grade Applanix DSS 439 digital aerial camera. In August
    2011, CIR aerial photographs for Pools 14-Open River South, Upper Mississippi River
    and Pools Dresden-Lockport, Illinois River were collected at 16u00e2u0080u009d/pixel
    with the same camera. All CIR aerial photos were orthorectified, mosaicked, compressed,
    and served via the UMESC Internet site. The CIR aerial photos were interpreted and
    automated using a 31-class LTRMP vegetation classification. The 2010/11 LCU databases
    were prepared by or under the supervision of competent and trained professional
    staff using documented standard operated procedures and are subject to rigorous
    quality control (QC) assurances (NBS, 1995).",nt"license_title": null,nt"extras":
